INSERT INTO `z_forum` VALUES (3,3,1590762519,1,0,27,39,93,'Disponibilizamos um servidor do [b]Discord[/b] para interagirmos melhor. Se quizer participar, basta acessar o servidor usando este link: [b]https://discord.gg/2Nem45Th[/b]','Discord do servidor !',1,1590762519,79,1606763878,'170.80.194.66',0,''),(6,6,1592268128,1,0,182,79,141,'[img]http://honera.com.br/images/honerab1.png[/img]\r\n</br><center><b></br>Sejam bem vindos, estamos anciosos por sua presena no nosso servidor.</b></center>\r\n</br>\r\n</br>\r\n\r\n<b>Server Features: </b></br></br>\r\n\r\n\r\n* [b][JOGABILIDADE] Skill Stages[img]https://www.tibiawiki.com.br/images/3/37/Physical_Damage_Icon.gif[/img], Experience Stages [img]https://www.tibiawiki.com.br/images/3/37/Physical_Damage_Icon.gif[/img]:[/b]  <a href=\"http://honera.com.br/?subtopic=serverinfo\">Server info</a> </br> \r\n* [b][STORE BOOSTS] Experience Boost[img]https://www.tibiawiki.com.br/images/8/86/Haste_Flash_Icon.gif[/img], Regen Boost[img]https://www.tibiawiki.com.br/images/7/79/Strengthened_Flash_Icon.gif[/img], Skills Boost[img]https://www.tibiawiki.com.br/images/3/37/Physical_Damage_Icon.gif[/img]:[/b]  <a href=\"http://honera.com.br/?subtopic=serverinfo\">Server info</a> </br> \r\n\r\n* [b]Online Points[/b][img]https://www.tibiawiki.com.br/images/f/ff/Achievement.gif[/img] Nos ajude permanecendo online e ganhe coins por isso!!![i](Ganhe pontos que podem ser trocados por coins, toda sexta feira no NPC Honera, perto do temploe de Thais)[/i]</br>\r\n\r\n* [b]Transferencia de addons e outfits[/b] ao comprar a [b]troca de sexo[/b] da Store. [img]https://www.tibiawiki.com.br/images/e/e8/Sex_Change_Icon.png[/img]</br>\r\n* [b][COMBOS][ITENS DE IMBUEMENT][/b] na store [i](Vendidos em Packs, isso mesmo.)[/i][img]https://www.tibiawiki.com.br/images/1/1f/Parcel.gif[/img]</br>\r\n\r\n[b]* Dawnport revisada. (Skills +rapidos)[/b] [img]https://www.tibiawiki.com.br/images/1/12/Woodling.gif[/img]</br>\r\n<center>[img]http://honera.com.br/images/honera/adawn3.png[/img]</center></br>\r\n Para ir para main atraves de dawnport primeiramente pegue o level 8 e apos fale com a npc [b]Oressa[/b]: [i](hi, choose, yes)[/i] apos a porta correspondente a sua vocacao estara liberada. [i] (nao esqueca de pegar os itens iniciais no bau) [/i]</br>\r\n\r\n[b]* Rookgaard revisada. (lento)[/b][img]https://www.tibiawiki.com.br/images/4/42/Spike_Sword.gif[/img]</br>\r\n\r\n[b]* Autoloot por modal window com sistema de Backpack. [/b]</br>\r\nBuscar loots do monstro e selecionar a backpack:\r\n[i]!add rat[/i]</br><center>\r\n[img]http://honera.com.br/images/honera/a10.png[/img]\r\n[img]http://honera.com.br/images/honera/a12.png[/img]\r\n[img]http://honera.com.br/images/honera/a13.png[/img]\r\n[img]http://honera.com.br/images/honera/a14.png[/img]\r\n</center></br>\r\nRemovendo loots:\r\n[i]Pelo menu do !add, ou opcionalmente !autoloot[/i]</br>\r\n<center>\r\n[img]http://honera.com.br/images/honera/a15.png[/img][img]http://honera.com.br/images/honera/a16.png[/img]\r\n</center>\r\n\r\n\r\n* Launcher AutoUpdater. (Baixe nosso client e se mantenha atualizado)</br>','Novidades!',0,1592268128,79,1599882192,'186.251.86.19',0,''),(8,8,1603734885,1,0,11,39,93,'Bravos aventureiros, meu nome e ZENONIA.\r\n\r\n\r\nPrimeiramente irei me apresentar a voces, explicando um pouco da minha histpria.\r\n\r\n\r\nPor muitos anos este mundo era vazio e a escuridao pairava diante do universo, entao os Deuses providenciaram tudo.\r\nMas com o passar dos anos, os guerreiros se sentiram mais distantes dos Deuses e estavam perdendo sua fe.\r\nEntao minha mae Fafnar, pediu para que eu viesse ao encontro destes guerreiros para que voltasse a ter fe.\r\nSabendo das circunstancias que os guerreiros viviam, foi oferecido uma troca pela sua lealdade.\r\nFafnar vos oferece riquezas para que tenham uma vida prospera, mas em troca tera que dar a ela algo muito mais valioso que fara jus a natureza de minha mae.\r\n\r\n\r\nEstando Online por 1 Hora, voce recebera 1 Online Point.\r\nNeste Npc, voce podera trocar 5 Online Points por 1 Tibia Coin . O NPC Zeno estara disponivel em Thais, ao lado do templo.\r\n\r\nPara verificar quantos Points voce possui, bastar usar o comando !Points.','Npc Honera',1,1603734885,79,1606764623,'170.80.194.69',0,'');
